const e=[{author:"Andre Pestana",updated:"2022-10-09T17:55:54.000Z",title:"Welcome to my blog! \u{1F389}",path:"/sections/blog/posts/welcome-to-maintainer-month.html",excerpt:"Hello and welcome! I hope this is the first post of a thousands more.For a long time I've been looking for a blog solution like vuepress or vitepress which could give me some freedom to do the thingsmy way, would be low cost and simple. I used Jekyll before and it was cooll but it is written in Ruby. Now I'm using vitepress and some of the features I like from vitepress are:"}],t=[{title:"JS Cheat Sheet",updated:"2022-10-09T17:53:39.000Z",author:"Andre Pestana",tags:"cheatsheet, javascript",path:"/sections/articles/posts/js-cheat-sheet.html",excerpt:"This is a WIP and I intend to include here some of useful things for JS developers to remember.It will be also a good way for me to structure the knowledge of the language like separatingsync and async methods and other things I feel they are important along the way."}],a=[{title:"Pestana World game",updated:"2022-10-10T01:07:51.000Z",author:"Andre Pestana",tags:"game, javascript, phaser, fun",path:"/sections/projects/posts/pestana-world-game.html",excerpt:"It\u2019s just a simple arcade game I started developing to learn Phaser3 and have some fun. Phaser 3 is a javascript framework and it makes development really fun."}],s={blog:e,articles:t,projects:a},o={baseUrl:"https://andrepestana.github.io"};export{o as c,s as d};
